import React from 'react';
import { useLocation } from 'react-router';

function Order() {
    const location = useLocation();
    const {item} = location.state;

    return (
        <div className="order-wrapper">
            <h1>{item.name}</h1>
            <h1>{item.price}</h1>
        </div>
    )
}

export default Order;
